CYpp_-VK-krOaje6qTXqIWsvuPpQ\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/leFuF-zoVzA\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/leFuF-zoVzA\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/leFuF-zoVzA?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/leFuF-zoVzA?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"How I Made My Own iPhone - in China\"},\"description\":{\"simpleText\":\"I built a like-new(but really refurbished) iPhone 6S 16GB entirely from parts I bought in the public cell phone parts markets in Huaqiangbei.  And it works!\\n\\nHow much did it cost? Answer here: https:\/\/youtu.be\/-KucQDXnKws\\n\\nI've been fascinated by the cell phone parts markets in Shenzhen, China for a while.  I'd walked through them a bunch of times, but I still didn't understand basic things, like how they were organized or who was buying all these parts and what they were doing with them.\\n\\nSo when someone mentioned they wondered if you could build a working smartphone from parts in the markets, I jumped at the chance to really dive in and understand how everything works.  Well, I sat on it for nine months, and then I dove in.\\n\\nMore details at: https:\/\/strangeparts.com\/how-i-made-my-own-iphone-in-china\/\\n\\nMy Gear:\\nI shot it on this camera: http:\/\/amzn.to\/2B0Snke\\nAnd also with this: http:\/\/amzn.to\/2BhdF1e\\nAnd recorded sound on this: http:\/\/amzn.to\/2CFuyPv\\nCollaborative editing software: http:\/\/bit.ly\/frameio-sp\\n\\nFacebook: http:\/\/facebook.com\/strangepartscom\\nTwitter: http:\/\/twitter.com\/strangepartscom\\nInstagram: http:\/\/instagram.com\/strangeparts_com\\nEmail Newsletter: http:\/\/strangeparts.com\/\\n\\nSpecial thanks to everyone that helped:Ian Lesnet (dangerousprototypes.com), Jin Lin (dangerousprototypes.com and flylin.co),  Helen, Frank, David, Wyman from G-Lon Cell Phone Repair School (facebook.com\/wyman.liu.1), Charles Pax (paxinstruments.com), Patrick O'Doherty, Matt Turzo, Richard Littauer, the EFF, Bunnie Huang (bunniestudios.com), Sean Cross (xobs.io), all the rest of my friends in China that have been supportive, and most importantly all the Huaqiangbei market sellers that were so generous with their time and advice!\\n\\n#StrangeParts #PhoneAdventures #China\"},\"lengthSeconds\":\"1429\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCO8DQrSp5yEP937qNqTooOw\",\"externalChannelId\":\"UCO8DQrSp5yEP937qNqTooOw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\" /-KucQDXnKws","navigationEndpoint":{"clickTrackingParams":"CJsBEM2rARgBIhMI7tq4ufiZ6QIVDrrECh3megEy","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=-KucQDXnKws","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"-KucQDXnKws"}}},{"text":"\n\nI've been fascinated by the cell phone parts markets in Shenzhen, China for a while.  I'd walked through them a bunch of times, but I still didn't understand basic things, like how they were organized or who was buying all these parts and what they were doing with them.\n\nSo when someone mentioned they wondered if you could build a working smartphone from parts in the markets, I jumped at the chance to really dive in and understand how everything works.  Well, I sat on it for nine months, and then I dove in.\n\nMore details at: "},{"text":"https://strangeparts.com/how-i-made-m...","navigationEndpoint":{"clickTrackingParams":"CJsBEM2rARgBIhMI7tq4ufiZ6QIVDrrECh3megEySLCuoef-wtvwlQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=leFuF-zoVzA\u0026redir_token=bVjkZEQXtUPvHZ8FVqVN9gHEChl8MTU4ODY3MjUxN0AxNTg4NTg2MTE3\u0026q=https%3A%2F%2Fstrangeparts.com%2Fhow-i-made-my-own-iphone-in-china%2F\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=leFuF-zoVzA\u0026redir_token=bVjkZEQXtUPvHZ8FVqVN9gHEChl8MTU4ODY3MjUxN0AxNTg4NTg2MTE3\u0026q=https%3A%2F%2Fstrangeparts.com%2Fhow-i-made-my-own-iphone-in-china%2F\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nMy Gear:\nI shot it on this camera: "},{"text":"http://amzn.to/2B0Snke","navigationEndpoint":{"clickTrackingParams":"CJsBEM2rARgBIhMI7tq4ufiZ6QIVDrrECh3megEySLCuoef-wtvwlQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=leFuF-zoVzA\u0026redir_token=bVjkZEQXtUPvHZ8FVqVN9gHEChl8MTU4ODY3MjUxN0AxNTg4NTg2MTE3\u0026q=http%3A%2F%2Famzn.to%2F2B0Snke\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=leFuF-zoVzA\u0026redir_token=b qiangbei.  And it works!\n\nHow much did it cost? Answer here: https://youtu.be/-KucQDXnKws\n\nI've been fascinated by the cell phone parts markets in Shenzhen, China for a while.  I'd walked through them a bunch of times, but I still didn't understand basic things, like how they were organized or who was buying all these parts and what they were doing with them.\n\nSo when someone mentioned they wondered if you could build a working smartphone from parts in the markets, I jumped at the chance to really dive in and understand how everything works.  Well, I sat on it for nine months, and then I dove in.\n\nMore details at: https://strangeparts.com/how-i-made-my-own-iphone-in-china/\n\nMy Gear:\nI shot it on this camera: http://amzn.to/2B0Snke\nAnd also with this: http://amzn.to/2BhdF1e\nAnd recorded sound on this: http://amzn.to/2CFuyPv\nCollaborative editing software: http://bit.ly/frameio-sp\n\nFacebook: http://facebook.com/strangepartscom\nTwitter: http://twitter.com/strangepartscom\nInstagram: http://instagram.com/strangeparts_com\nEmail Newsletter: http://strangeparts.com/\n\nSpecial thanks to everyone that helped:Ian Lesnet (dangerousprototypes.com), Jin Lin (dangerousprototypes.com and flylin.co),  Helen, Frank, David, Wyman from G-Lon Cell Phone Repair School (facebook.com/wyman.liu.1), Charles Pax (paxinstruments.com), Patrick O'Doherty, Matt Turzo, Richard Littauer, the EFF, Bunnie Huang (bunniestudios.com), Sean Cross (xobs.io), all the rest of my friends in China that have been supportive, and most importantly all the Huaqiangbei market sellers that were so generous with their time and advice!\n\n#StrangeParts #PhoneAdventures #China","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/leFuF-zoVzA/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBUL2S8alAAXZTMDCGX6hhPXqsb_A","width":168,"height":94},{"url":"https://i.ytimg.com/vi/leFuF-zoVzA/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAA
